  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:22.570906\",\n\t\"name\": \"back-bay-report-on-salinity-and-water-clarity-in-1986\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Salinity, turbidity and various other water
  quality parameters were monitored monthly in 1986 at 24 stations on Back Bay. Results
  show Back Bay to be brackish (mean salinity 10.1% SS) and very turbid (mean Secchi
  disc visibility 7.3 inches and mean turbidity 25.1 NTU). Water clarity was the poorest
  since records are available (1959). The mean salinity for 1986 was the third highest
  since 1962 (year of the \"Ash Wednesday\" storm) . The salinity level was relatively
  uniform between stations in 1986, a condition which contrasts markedly with past
  years and is attributed to the absence of saltwater pumped into the bay in 1986.\",\n\t\"license_title\":
